function interpret(e,t){var n=0,r="",i=0,s=[0],o=0,u="";var a=function(e,t){var n=0,r="";for(var i=t-1;i>=0;i--){r=e.charAt(i);if(n==0&&r=="[")return i;else{if(r=="[")n--;if(r=="]")n++}}return-1};var f=function(e,t){var n=0,r="";for(var i=t+1;i<e.length;i++){r=e.charAt(i);if(n==0&&r=="]")return i;else{if(r=="]")n--;if(r=="[")n++}}return-1};e=e.replace(/[^<>,\.\[\]\+-]/g,"");for(n=0;n<e.length;n++){r=e.charAt(n);switch(r){case"+":s[o]++;break;case"-":s[o]--;break;case">":o++;if(o==s.length)s.push(0);break;case"<":o--;break;case".":u+=String.fromCharCode(s[o]);break;case",":if(i==t.length)s[o]=0;else s[o]=t.charCodeAt(i++);break;case"[":if(s[o]==0)n=f(e,n);break;case"]":if(s[o]!=0)n=a(e,n);break}}return u}
